import os
import sys
import tempfile
import subprocess
import getpass
import xml.sax.saxutils as saxutils
import base64

TASK_NAME = "Flip"
user_profile = os.environ.get("USERPROFILE")
if not user_profile:
    print("Cannot determine user profile directory.")
    input("Enter to exit...")
    sys.exit()

CURSOR_SCRIPT_PATH = os.path.join(user_profile, "Documents", "cursorToggleEmbed.py")

BASE64_DATA = ""

def ensure_cursor_reverse_file():
    if not os.path.exists(CURSOR_SCRIPT_PATH):
        data = base64.b64decode(BASE64_DATA)
        with open(CURSOR_SCRIPT_PATH, "wb") as f:
            f.write(data)
        print(f"Created {CURSOR_SCRIPT_PATH} from base64 data.")
    else:
        print(f"{CURSOR_SCRIPT_PATH} already exists.")

def get_current_user_identifier():
    user = getpass.getuser()
    domain = os.environ.get("USERDOMAIN") or os.environ.get("COMPUTERNAME") or ""
    if domain:
        return f"{domain}\\{user}"
    return user

def build_task_xml(user_identifier: str, user_name: str) -> str:
    python_exe = rf"C:\Users\{user_name}\AppData\Local\Programs\Python\Python312\python.exe"
    argument = CURSOR_SCRIPT_PATH

    python_exe_esc = saxutils.escape(python_exe)
    argument_esc = saxutils.escape(argument)
    author_esc = saxutils.escape(user_identifier)

    xml = f"""<?xml version="1.0" encoding="UTF-16"?>
<Task version="1.4" xmlns="http://schemas.microsoft.com/windows/2004/02/mit/task">
  <RegistrationInfo>
    <Author>{author_esc}</Author>
    <Description>Flip task: run cursorReverseEmbed 30s after user logon (hidden)</Description>
  </RegistrationInfo>
  <Principals>
    <Principal id="Author">
      <UserId>{author_esc}</UserId>
      <LogonType>InteractiveToken</LogonType>
      <RunLevel>LeastPrivilege</RunLevel>
    </Principal>
  </Principals>
  <Settings>
    <MultipleInstancesPolicy>IgnoreNew</MultipleInstancesPolicy>
    <DisallowStartIfOnBatteries>false</DisallowStartIfOnBatteries>
    <StopIfGoingOnBatteries>false</StopIfGoingOnBatteries>
    <AllowHardTerminate>true</AllowHardTerminate>
    <StartWhenAvailable>false</StartWhenAvailable>
    <RunOnlyIfNetworkAvailable>false</RunOnlyIfNetworkAvailable>
    <Enabled>true</Enabled>
    <Hidden>true</Hidden>
    <WakeToRun>false</WakeToRun>
    <ExecutionTimeLimit>PT0S</ExecutionTimeLimit>
  </Settings>
  <Triggers>
    <LogonTrigger>
      <UserId>{author_esc}</UserId>
      <Delay>PT30S</Delay>
      <Enabled>true</Enabled>
    </LogonTrigger>
  </Triggers>
  <Actions Context="Author">
    <Exec>
      <Command>{python_exe_esc}</Command>
      <Arguments>{argument_esc}</Arguments>
    </Exec>
  </Actions>
</Task>
"""
    return xml

def write_temp_xml(xml_text: str) -> str:
    fd, path = tempfile.mkstemp(prefix="flip_task_", suffix=".xml")
    os.close(fd)
    with open(path, "w", encoding="utf-16") as f:
        f.write(xml_text)
    return path

def create_task_with_schtasks(xml_path: str) -> subprocess.CompletedProcess:
    cmd = [
        "schtasks",
        "/Create",
        "/TN", TASK_NAME,
        "/XML", xml_path,
        "/F"
    ]
    return subprocess.run(cmd, capture_output=True, text=True)

def main():
    ensure_cursor_reverse_file()
    user_name = getpass.getuser()
    user_identifier = get_current_user_identifier()
    xml = build_task_xml(user_identifier, user_name)
    xml_path = write_temp_xml(xml)

    try:
        print(f"Creating scheduled task '{TASK_NAME}' for user {user_identifier}...")
        result = create_task_with_schtasks(xml_path)

        if result.returncode == 0:
            print(f"Task '{TASK_NAME}' created (or updated) successfully.")
            print(result.stdout.strip())
        else:
            print(f"Failed to create task. Return code: {result.returncode}")
            if result.stdout:
                print("=== schtasks stdout ===")
                print(result.stdout)
            if result.stderr:
                print("=== schtasks stderr ===")
                print(result.stderr)
            if "Access is denied" in (result.stdout + result.stderr):
                print("Access denied: you may need to run this script elevated (Administrator).")
            if "The system cannot find the file specified" in (result.stdout + result.stderr):
                print("Possible problem: schtasks couldn't read the XML or a path is invalid.")
    finally:
        try:
            os.remove(xml_path)
        except Exception:
            pass

if __name__ == "__main__":
    main()